import React from 'react';
import { Avatar, Typography, List, ListItem, ListItemText } from '@mui/material';
import man from '../component/assets/Avatars/man.png';
import nurse from '../component/assets/Avatars/nurse.png';
import assistant from '../component/assets/Avatars/shop-assistant.png';
import singer from '../component/assets/Avatars/singer.png';
import steward from '../component/assets/Avatars/steward.png';


const MessagesPage = () => {
  const classes = useStyles(); // Use makeStyles
  const users = [
    {
      name: 'User 1',
      avatar: man,
      message: 'Hello, how are you?',
    },
    {
      name: 'User 2',
      avatar: nurse,
      message: 'Hi there!',
    },
    {
      name: 'User 3',
      avatar: assistant,
      message: 'What are you up to?',
    },
    {
      name: 'User 4',
      avatar: singer,
      message: 'Good morning!',
    },
    {
      name: 'User 5',
      avatar: steward,
      message: 'Let\'s catch up later.',
    },
  ];

  return (
    <div className="messages-page">
      <div className="messages-list">
        <Typography variant="h4">Messages</Typography>
        <List>
          {users.map((user, index) => (
            <ListItem button key={index}>
              <Avatar src={user.avatar} alt={user.name} />
              <ListItemText
                primary={user.name}
                secondary={
                  <Typography sx={{color:p}} className={classes.whiteText}>{user.message}</Typography>
                }
              />
            </ListItem>
          ))}
        </List>
      </div>
      <div className="messenger-logo">
        <img src="/path/to/messenger-logo.png" alt="Messenger Logo" />
      </div>
    </div>
  );
};

export default MessagesPage;
